import React from "react";

function StudentHome() {
  return (
    <div>
      <h1>Welcome, Student</h1>
      <h3>Please use navigate through the buttons above.</h3>
      <p>Have a great day!</p>
      <p>Note: Please refresh page or go back to visit Login page</p>
    </div>
  );
}

export default StudentHome;
